const CategoryCard = ({ category, isSelected, onClick }) => {
  return (
    <div
      onClick={onClick}
      className={`
        flex flex-col items-center cursor-pointer
        transition-all duration-200 hover:scale-105
        ${
          isSelected
            ? "bg-[#F67F20] text-white shadow-lg"
            : "bg-white text-gray-700 shadow-md border border-gray-100"
        }
      `}
      style={{
        width: "120px",
        height: "227px",
        borderRadius: "24px",
        padding: "27px 30px",
        gap: "23px",
        display: "flex",
        flexDirection: "column",
        justifyContent: "space-between",
      }}
    >
      {/* Icon Section */}
      <div className="flex-1 flex items-center justify-center">
        <div className={isSelected ? "text-white" : "text-[#F67F20]"}>
          {category.icon}
        </div>
      </div>

      {/* Label and Arrow Section */}
      <div className="flex flex-col items-center gap-4">
        <h3
          className={`text-center mx-auto ${
            isSelected ? "text-white" : "text-gray-800"
          }`}
          style={{
            height: "25px",
            fontFamily: "Poppins",
            fontWeight: 600,
            fontSize: "14px",
            lineHeight: "175%",
            letterSpacing: "2%",
          }}
        >
          {category.label}
        </h3>

        {/* Horizontal line after title */}
        <div
          className={`w-8 h-0.5 mx-auto ${
            isSelected ? "bg-white" : "bg-[#F67F20]"
          }`}
        />

        {/* Arrow Button */}
        <div
          className={`
          w-8 h-8 rounded-full flex items-center justify-center
          ${isSelected ? "bg-white bg-opacity-20" : "bg-[#F67F20]"}
        `}
        >
          <svg
            width="12"
            height="12"
            viewBox="0 0 24 24"
            fill="none"
            className={isSelected ? "text-[#F67F20]" : "text-white"}
          >
            <path
              d="M9 18L15 12L9 6"
              stroke="currentColor"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
            />
          </svg>
        </div>
      </div>
    </div>
  );
};

export default function Categories() {
  const [selectedCategory, setSelectedCategory] = useState(1);

  return (
    <section className="container mx-auto px-4 py-8">
      <div className="mb-6 flex items-center justify-between">
        <h2
          className="text-[#07143B]"
          style={{
            fontFamily: "Playfair Display",
            fontWeight: 700,
            fontSize: "30px",
            lineHeight: "130%",
            letterSpacing: "2%",
          }}
        >
          Menu category
        </h2>
      </div>

      {/* Categories in one line with spacing */}
      <div className="flex justify-between items-center w-full">
        {categoryItems.map((category) => (
          <CategoryCard
            key={category.id}
            category={category}
            isSelected={selectedCategory === category.id}
            onClick={() => setSelectedCategory(category.id)}
          />
        ))}
      </div>
    </section>
  );
}
